          <Button
            tag="label"
            className={classNames("btn-simple", {
              active: "",
            })}
            color="info"
            id="0"
            size="sm"
            onClick={() => {
              "";
            }}
          >
            <span className="d-none d-sm-block d-md-block d-lg-block d-xl-block">
              Weekly
            </span>
          </Button>

          <Button
            tag="label"
            className={classNames("btn-simple", {
              active: "",
            })}
            color="info"
            id="0"
            size="sm"
            onClick={() => {
              "";
            }}
          >
            <span className="d-none d-sm-block d-md-block d-lg-block d-xl-block">
              Monthly
            </span>
          </Button>
        </ButtonGroup>

        <ProgressBar />
        <Row className="card-view">
          <Chart1 />
        </Row>
      </div>
    </>
  );
}

export default DefectAnalytics;
